import React from "react";

const News = ({ newsData }) => {
  return (
    <div>
      {newsData.map((item) => {
        return (
          <section>
            <a href={item.webUrl}>
              <h3>{item.webTitle}</h3>
              <img src={item.fields.thumbnail} alt="" />
            </a>
          </section>
        );
      })}
    </div>
  );
};

export default News;
